        setEmailCountData([statusCountObject]);
        console.log("wrapper", [statusCountObject]);
      }
    } catch (error) {
      console.error(error);
    }
  };

  const cols = [
    {
      title: "To",
      dataIndex: "To",
      render: (record, index) => {
        // console.log("index...>>>",record.idx);
        return (
          <div>
            {" "}
            {record ?
            <>
            <img
              style={{ cursor: "pointer", marginRight: "8px" }}
