                setShowModal(true);
              }}
            >
              +
            </Style.Button>
          </div>
        </Style.HealthCardHeader>
        {emailData.length > 0 ? ( // Check if emailData is not empty
          <List
            data={emailData.data}
            name={"email"}
            cols={cols}
